import './Style.css'
import { Link } from 'react-router-dom';
function Login() {
  
  const [inputValue, setInputValue] = useState('');
  const [inputValuea, setInputValuea] = useState('');
  const handleButton= () => {
    alert(`You entered:'+ ${inputValue} ` );
  };
  const handleInputChange = (event) => {
    setInputValue(event.target.value);
  };

  const handleInputChangea = (event) => {
    setInputValuea(event.target.value);
  };
  return (
    <>
    <div  class="for">
    < div class="wrapper">
    <div  class='forma'>
      <h1>Login</h1>
      <div class="input-box">
        <input type="text" placeholder="Username"  value={inputValue}
        onChange={handleInputChange}/>
        <span class="material-symbols-outlined">
person
</span>
      </div>
      <div class="input-box">
        <input  placeholder="Password"  value={inputValuea}
        onChange={handleInputChangea} required/>
        <span class="material-symbols-outlined">
lock
</span>
 
      </div>
        <div class="remember-forget">
          <label> <input type="checkbox"/>Remember me </label>
          <a href='#' >forget password? </a>
       
        </div>
         
        <button type="submit" class="btn" onClick={handleButton}>Login</button>
        <div class="register-link">
         <Link to='/signup'> <p>Don't have an account? Register  </p></Link>
        </div>
    </div>
    </div>
    </div>
     
    </>
     
  )
}

export default Login
